  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "## Calculation of the sortino ratio for the individual stocks of the portfolio"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 34,
   "metadata": {},
   "outputs": [],
   "source": [
    "downside_volitality = log_returns[log_returns < 0].rolling(TRADING_DAYS, center=True, min_periods=10).std() * np.sqrt(TRADING_DAYS)\n",
    "sortino_ratio = (log_returns.rolling(TRADING_DAYS).mean() - risk_free_return) / downside_volitality\n",
    "annualized_sortino_ratio = ((log_returns.mean() - risk_free_return) / downside_volitality.std()) * np.sqrt(252)"
   ]
  },
